import React from "react";

import InfiniteCarousel from "react-leaf-carousel";

const Saleproduct = () => {
  return (
    <InfiniteCarousel
      breakpoints={[
        {
          breakpoint: 500,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
          },
        },
        {
          breakpoint: 800,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
          },
        },
      ]}
      showSides={true}
      sidesOpacity={10}
      sideSize={0}
      slidesToScroll={3}
      slidesToShow={5}
      lazyLoad={true}
    >
      <div>
        <img
          alt=""
          src="https://lumen.thinkpro.vn//backend/uploads/product/avatar/2020/11/20/swift514_00gold.jpg"
        />
      </div>
    </InfiniteCarousel>
  );
};

export default Saleproduct;
